script: |
  super -f text -I q1725.spq | sort > q1725.out

inputs:
  - name: q1725.spq
    data: |
      SELECT ALL - + 94 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + col2 ) * - - col0 * 76 - - ( 86 ) / 43 IS NOT NULL;
  - name: tab2

outputs:
  - name: q1725.out
    data: |
      -94
      -94
      -94
